import React from 'react'
import { Link } from 'react-router-dom';

const Video = (props) => {
    const {id,naziv,youtubeLink,thumbnailPath,thumbnailVelicina} = props;
    console.log(props);
    return (
        <Link className={`col-lg-${thumbnailVelicina} col-xl-${thumbnailVelicina} col-sm-12 col-xs-12 col-12 w-100 p-1 video-link`} to={`/video/${id}`}>
            <img /*src={require(thumbnailPath)}*/ className="w-100 h-100" />
            <span className="video-name"> {naziv} </span>
        </Link>
    )
}

export default Video
